package com.kuaixiu.sjBusiness.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2019-05-26 下午06:00:35 * @version: V 1.0 */public class SjVirtualTeam extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     *      */    private Long id ;    /**     * loginId     */    private Integer LoginId;    /**     * 经营单元     */    private Integer managementUnitId ;    /**     *      */    private String name ;    /**     *      */    private String phone ;    /**     * 岗位     */    private String post ;    /**     * 支局数量     */    private Long officeNum ;    public Long getId(){        return this.id;    }    public void setId(Long id){        this.id=id;    }    public Integer getLoginId() {        return LoginId;    }    public void setLoginId(Integer loginId) {        LoginId = loginId;    }    public Integer getManagementUnitId(){        return this.managementUnitId;    }    public void setManagementUnitId(Integer managementUnitId){        this.managementUnitId=managementUnitId;    }    public String getName(){        return this.name;    }    public void setName(String name){        this.name=name;    }    public String getPhone(){        return this.phone;    }    public void setPhone(String phone){        this.phone=phone;    }    public String getPost(){        return this.post;    }    public void setPost(String post){        this.post=post;    }    public Long getOfficeNum(){        return this.officeNum;    }    public void setOfficeNum(Long officeNum){        this.officeNum=officeNum;    }}